text:
@UPS I have been waiting all day for a packg to be delivered only to be lied to by the people at UPS.
When I called my calls were sent to outside the US.
This company has horrible customer service.

@UPS Do NOT use UPS.
They lie to their customes and keep you thinking the packages will be delivered only to keep you hoping till they close for the day.
UPS LIES TO CUSTOMERS
